const VideoPlayer = (props) => {
  const { videoLink } = props;
  return (
    <div>
      <iframe
        width="420"
        height="315"
        src={this.videoLink + "?autoplay=1"}
      ></iframe>
    </div>
  );
};

export default VideoPlayer;
